import '../styles/ToDo.css';

class ToDo extends Component {
    render() {
        return (
            <div className="ToDo">
                <input type="text" />
                <input type="button" value="add"/>
                <button value="show" onClick="handleClick" />
            </div>
        )
    }
}

export default ToDo;
